!function(){"use strict";$.getJSON(window.apiUrl+"/restaurants/recommended/"+window.username+"/",function(e){console.log(e);var o=$(".template").children().first().clone();$.each(e,function(e,n){var i=o.clone();i.find(".name").text(n.name),i.find(".price-range .low").text(n.price_low),i.find(".price-range .high").text(n.price_high),i.find(".address").text(n.location_name),i.find(".photo img").attr("src","/images/"+n.photo),n.is_following&&i.find(".follow-button").addClass("following");var l="";$.each(n.followed_by,function(e,o){l+='<img src="images/'+o.profile_pic+'" />'});var t=n.following_count-n.followed_by.length;t>0?i.find(".followed-by .num").text(t):i.find(".followed-by .more-following").hide(),i.find(".followed-by").prepend(l),$(".main-div").append(i)})})}();